import React from "react";

function clouds() {
    return (
        <div>
            <img class="top-cloud" src="./public/images/real_cloud.png" alt="Cloud-img"></img>
            <img class="bottom-cloud" src="/public/images/real_cloud.png" alt="cloud-img"></img>
        </div>
    )
};

export default clouds;
